comparison_text_referral_age.query:
q = load "${App.Datasets.HLS_Referral8_tp.FullyQualifiedName}";
q = group q by all;
q = foreach q generate {{coalesce(cell(referral_age.result, 0, "avg_Lead_Age_Days"),0).asString()}} as 'selected_referral', {{coalesce(cell(referral_age_all.result, 0, "avg_Lead_Age_Days"),0).asString()}} as 'all';
q = foreach q generate case when 'selected_referral' > 'all' then "falling behind" when 'selected_referral' < 'all' then "on track" else "on track" end as 'referral_age_text', case when 'selected_referral' > 'all' then "Behind" when 'selected_referral' < 'all' then "On Track" else "On Track" end as 'referral_age_header', case when 'selected_referral' > 'all' then "#A40006" when 'selected_referral' < 'all' then "#16AA25" else "#16AA25" end as 'referral_age_color';

conversion_insurance.query:
a = load "${App.Datasets.HLS_Referral8_tp.FullyQualifiedName}";
a = filter a by 'HealthCloudGA_InsuranceType__c' == "Medicare";
b = filter a by 'IsConverted' == "true";
c = group a by all full, b by all;
c = foreach c generate round(100*(count(b)/count(a)),1) as 'conversion_pct';

conversion_specialty.query:
a = load "${App.Datasets.HLS_Referral8_tp.FullyQualifiedName}";
a = filter a by 'HealthCloudGA_Specialty__c' == "Orthopedics";
b = filter a by 'IsConverted' == "true";
c = group a by all full, b by all;
c = foreach c generate round(100*(count(b)/count(a)),1) as 'conversion_pct';

comparison_text.query:
q = load "${App.Datasets.HLS_Referral8_tp.FullyQualifiedName}";
q = group q by all;
q = foreach q generate {{coalesce(cell(conversion_specialty.result, 0, "conversion_pct"),0).asString()}} as 'specialty', {{coalesce(cell(conversion_insurance.result, 0, "conversion_pct"),0).asString()}} as 'insurance', {{coalesce(cell(conversion_type_of_service.result, 0, "conversion_pct"),0).asString()}} as 'type_of_service', {{coalesce(cell(conversion_all.result, 0, "conversion_pct"),0).asString()}} as 'all';
q = foreach q generate case when 'specialty' < 'all' then "worse than" when 'specialty' > 'all' then "better than" else "the same as" end as 'specialty_text', case when 'insurance' < 'all' then "worse than" when 'insurance' > 'all' then "better than" else "the same as" end as 'insurance_text', case when 'type_of_service' < 'all' then "worse than" when 'type_of_service' > 'all' then "better than" else "the same as" end as 'type_of_service_text';

referral_age.query:
q = load "${App.Datasets.HLS_Referral8_tp.FullyQualifiedName}";
q = group q by all;
q = foreach q generate round(avg('Lead_Age_Days'),1) as 'avg_Lead_Age_Days';
q = limit q 2000;

