referral_activities.query:
dataset = load "${App.Datasets.HLS_Referral8_tp.FullyQualifiedName}";

a = filter dataset by 'Id' == "00QB0000006MTUjMAO";
a = group a by all;
a = foreach a generate avg('Lead_Age_Days') as 'avg_Lead_Age_Days', "This Referral (on track)" as 'ReferralType', 1 as 'order';

b = filter dataset by 'HealthCloudGA_Specialty__c' == "Cardiology";
b = group b by all;
b = foreach b generate avg('Lead_Age_Days') as 'avg_Lead_Age_Days', "Avg Specialty" as 'ReferralType', 2 as 'order';

c = filter dataset by 'HealthCloudGA_TypeOfService__c' == "Surgery";
c = group c by all;
c = foreach c generate avg('Lead_Age_Days') as 'avg_Lead_Age_Days', "Avg Type of Service" as 'ReferralType', 3 as 'order';

d = filter dataset by 'HealthCloudGA_InsuranceType__c' == "Medicare";
d = group d by all;
d = foreach d generate avg('Lead_Age_Days') as 'avg_Lead_Age_Days', "Avg Insurance Type" as 'ReferralType', 4 as 'order';

e = group dataset by all;
e = foreach e generate avg('Lead_Age_Days') as 'avg_Lead_Age_Days', "Avg Overall" as 'ReferralType', 5 as 'order';

f = union a,b,c,d,e;
f = order f by 'order' asc;
